const ulStyle = {

};

const liStyle = {
  listStyle: 'none',
  float: 'left',
  marginRight: '10%',
};

const logoStyle = {
  width : 100,
};

const Partners = () => (
  <div>
  <ul style={ulStyle}>
    <li style={liStyle}><center><img style={logoStyle} src="../static/partners/amzn_logo.png"></img></center></li>
    <li style={liStyle}><center><img style={logoStyle} src="../static/partners/alibaba.png"></img></center></li>
    <li style={liStyle}><img style={logoStyle} src="../static/partners/amazon-japan-logo.png"></img></li>
    <li style={liStyle}><img style={logoStyle} src="../static/partners/coupang.png"></img></li>
    <li style={liStyle}><img style={logoStyle} src="../static/partners/naver.png"></img></li>
    <li style={liStyle}><img style={logoStyle} src="../static/partners/Shopee.png"></img></li>
  </ul>
</div>
);

export default Partners;
